import React from 'react';
import '../../App.css';
import LocationSection from '../LocationSection';
import '../LocationSection.css';


import GoogleMapReact from 'google-map-react'
import Marker from '../Marker'


const Map = ({lattitude, longitude, handleMarkerClick}) => {
  return (
   <div className='map'>
      <LocationSection />   

          <GoogleMapReact>
                    bootstrapURLKeys ={{ key: "AIzaSyDUnHLz8Esrh1pWB8W04uJC95LoEmINBcI" }}
                    defaultCenter={{lat: 37.777777, lng: -122.222}}
                    defaultZoom={ 14 }
                >   

                <Marker lat={lattitude} lng={longitude}/>


                </GoogleMapReact>

    </div>
  );
}

export default Map
